import "./NavLinks.scss";
import {NavLink} from "react-router-dom";
import {useState} from "react";

interface NavLinksProperties {
    navItems: any;
}

const NavLinks = (props: NavLinksProperties) => {
    const {navItems} = props;

    const [showMenu, setShowMenu] = useState(false);

    const toggleMenu = () => {
        setShowMenu(!showMenu);
    }

    const individualNavItems = navItems.map((navItem: { link: string; label: string; }) => {
        return (
            <NavLink
                className="nav__links__item"
                to={navItem.link}
                key={navItem.label}
            >
                {navItem.label}
            </NavLink>
        );
    });



    return (
        <div className="nav__links">

            {individualNavItems}
        </div>
    );
};

export default NavLinks;
